import logo from './logo.svg';
import './App.css';

function App() {
  return (
    <>
      <div className="App-header">
        <div className="child1">
          <div className="coutingResult">0</div>
          <div className="buttons">
            <div className="positiveButton">Increase</div>
            <div className="negativeButton">Decrease</div>
          </div>
        </div>
      </div>
    </>
  );
}

export default App;
